코로나가 미국이든 한국이든 좀처럼 회복되지 않아서 아직 미국으로 돌아갈수도, 한국에서 무언가를 시작할수도 없기에 한달전에 예약한 제주도로 조용히 날아왔습니다. 

 청주공항 통해서 오니 사람도 없고 쾌적하고 너무 좋았어요. 다만 공항을 보면, 비행기를 보면, 두려움에 가득차 32시간 미국에서 한국으로 돌아오던 날이 트라우마가 되어서 심장이 좀 뛰더라구요 😅

아무것도 모르는 릴리아나는 단지 비행기 타는게 너무 좋을뿐이고 😅 비행시간이 겨우 1시간이라 아쉬워하고 ;; 
